import React from 'react'

import Auxiliary from './../../../../../hoc/Auxiliary';
import classes from './DibujoModelos.module.css';
import Botone from './Botone(2).png';

function DibujoModelos(props) {
   let modelo=null
    switch (props.modelo) {
        case "Botone":
            modelo=<img classes={classes.DibujoModelos} src={Botone} alt='botoneImg' />
            break;
    
        default:
            modelo=null;
            break;
    }

    return (
        <Auxiliary>
            {modelo}
        </Auxiliary>
    )
}

export default DibujoModelos
